  selector: 'app-bottom-footer',
  templateUrl: './bottom-footer.component.html',
  styleUrls: ['./bottom-footer.component.css']
})
export class BottomFooterComponent {

}
<footer class="footer">
    <p>Sabrina Giuliana Incinga 2023</p>
</footer>
